import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { Card, CardContent, Typography, Button, IconButton, Grid, TextField } from '@mui/material';
import Appbar from './Appbar.js';
import { useState } from 'react';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';

export default function Profile() {
  const [isLoggedIn, setIsLoggedIn] = useState(true);
  const userData = {
    shoppingCartItems: 3,
    username: "JohnDoe",
    email: "john.doe@example.com",
    contactNumber: "+123456789",
  };
  const [addresses, setAddresses] = useState([
    '123 Main St, Cityville',
    '456 Oak St, Townsville',
    '789 Maple St, Villagetown'
  ]);

  const handleDeleteAddress = (index) => {
    const updatedAddresses = addresses.filter((_, i) => i !== index);
    setAddresses(updatedAddresses);
  };

  return (
    <div>
      <Appbar isLoggedIn={isLoggedIn} userData={userData} />
      <Grid container justifyContent="center" alignItems="flex-start" spacing={1} style={{ backgroundColor: '#ededed'}}>

        {/* Profile Card */}
        <Card sx={{ padding: 2, marginTop: '32px', width: '80%', marginBottom: '32px'}}>
          <CardContent>
            <Typography gutterBottom variant="h6" component="div">
              Profile
            </Typography>
            <Typography variant="body1">
              <strong>Username:</strong> {userData.username}
            </Typography>
            <Typography variant="body1">
              <strong>Email:</strong> {userData.email}
            </Typography>
            <Typography variant="body1">
              <strong>Contact Number:</strong> {userData.contactNumber}
            </Typography>
            <Button variant="outlined" startIcon={<EditIcon />} sx={{ marginTop: '16px' }}>
              Edit
            </Button>
          </CardContent>
        </Card>

        {/* Shipping Address Card */}
        <Card sx={{ padding: 2, width: '80%', marginBottom: '32px'}}>
          <CardContent>
            <Typography gutterBottom variant="h6" component="div">
              Shipping Address
            </Typography>

            {/* Table of Shipping Addresses */}
            <TableContainer component={Paper}>
              <Table aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell><strong>#</strong></TableCell>
                    <TableCell><strong>Shipping Address</strong></TableCell>
                    <TableCell align="right"><strong>Action</strong></TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {addresses.map((address, index) => (
                    <TableRow key={index}>
                      <TableCell component="th" scope="row">
                        {index + 1}
                      </TableCell>
                      <TableCell>{address}</TableCell>
                      <TableCell align="right">
                        <IconButton color="error" onClick={() => handleDeleteAddress(index)}>
                          <DeleteIcon />
                        </IconButton>
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </CardContent>
        </Card>
      </Grid>
    </div>
  );
}
